			shellScript = "set -e\n\necho \"üöÄ Apollo iOS Code Generation\"\necho \"üìç SRCROOT: ${SRCROOT}\"\necho \"üìç PROJECT_DIR: ${PROJECT_DIR}\"\necho \"üìç PWD: $(pwd)\"\n\n# Try multiple possible paths for GitLabNetwork\nPOSSIBLE_PATHS=(\n    \"${SRCROOT}/Packages/GitLabNetwork\"\n    \"${PROJECT_DIR}/Packages/GitLabNetwork\"\n    \"${SRCROOT}/../Packages/GitLabNetwork\"\n    \"$(pwd)/Packages/GitLabNetwork\"\n    \"./Packages/GitLabNetwork\"\n)\n\nGITLAB_NETWORK_DIR=\"\"\n\nfor path in \"${POSSIBLE_PATHS[@]}\"; do\n    echo \"üîç Checking path: $path\"\n    if [ -d \"$path\" ]; then\n        GITLAB_NETWORK_DIR=\"$path\"\n        echo \"‚úÖ Found GitLabNetwork at: $GITLAB_NETWORK_DIR\"\n        break\n    fi\ndone\n\nif [ -z \"$GITLAB_NETWORK_DIR\" ]; then\n    echo \"‚ùå Error: GitLabNetwork package not found in any of these locations:\"\n    for path in \"${POSSIBLE_PATHS[@]}\"; do\n        echo \"   - $path\"\n    done\n    \n    echo \"\"\n    echo \"üìÇ Current working directory contents:\"\n    ls -la\n    \n    echo \"\"\n    echo \"üìÇ SRCROOT contents:\"\n    ls -la \"${SRCROOT}\" || echo \"SRCROOT not accessible\"\n    \n    exit 1\nfi\n\ncd \"$GITLAB_NETWORK_DIR\"\necho \"üìÇ Changed to directory: $(pwd)\"\n\n# List contents to verify we're in the right place\necho \"üìÇ Contents of GitLabNetwork directory:\"\nls -la\n\n# Check if apollo-ios-cli exists\nif [ ! -f \"./apollo-ios-cli\" ]; then\n    echo \"‚ùå Error: apollo-ios-cli not found.\"\n    echo \"üîß Attempting to extract CLI from Apollo package...\"\n    \n    # Try to extract CLI from Apollo package\n    if [ -f \".build/checkouts/apollo-ios/CLI/apollo-ios-cli.tar.gz\" ]; then\n        echo \"üì¶ Extracting Apollo CLI...\"\n        cd .build/checkouts/apollo-ios/CLI\n        tar -xf apollo-ios-cli.tar.gz\n        cp apollo-ios-cli \"../../../../\"\n        cd ../../../../\n        echo \"‚úÖ Apollo CLI extracted successfully\"\n    else\n        echo \"‚ùå Error: Apollo CLI not found. Please run 'swift build' first to download dependencies.\"\n        exit 1\n    fi\nfi\n\n# Check if configuration file exists\nif [ ! -f \"./apollo-codegen-config.json\" ]; then\n    echo \"‚ùå Error: apollo-codegen-config.json not found\"\n    echo \"üìÇ Current directory contents:\"\n    ls -la\n    exit 1\nfi\n\necho \"‚úÖ Found apollo-codegen-config.json\"\n\n# Only run in Debug configuration to avoid slowing down Release builds\nif [ \"${CONFIGURATION}\" = \"Debug\" ]; then\n    echo \"üîÑ Running Apollo Code Generation...\"\n    ./apollo-ios-cli generate\n    echo \"‚úÖ Apollo Code Generation completed successfully!\"\nelse\n    echo \"‚è≠Ô∏è  Skipping Apollo Code Generation in ${CONFIGURATION} configuration\"\nfi\n";
